import React, { Component } from "react";
import Plus from "../../images/плюсик.png";

export class Item extends Component {
    render() {
        return (
            <div>
                <a class="cars__plus"><img src={Plus} alt=""/></a>
                <img src={"./img/" + this.props.item.image} alt=""/>
                {this.props.item.title}
            </div>
        )
    }
}

export default Item;
